import {useDfpSlot} from "./useAdSlot";

const Header = ({ onclick }) => {

    useDfpSlot({
        path: '/21737763597/adunit-1',
        size: [320, 100],
        id: 'div-gpt-ad-1559997122392–0',
    });

    return(
            <header>
                <div
                    id="div-gpt-ad-1559997122392–0"
                    style={{ width: '320px', height: '100px' }}
                />
                <p>Header</p>
                <div id="header-slot"
                onClick={(e) => onclick}></div>
            </header>

    )
};

export default Header;
